import React from 'react'
import './style.css';
import Article from './Components/Article';
import ButtonPress from './Components/ButtonPress';


function App() {
  return (
    <div className="App">
      <Article />
      <Article />
      <div className='col'>
      <ButtonPress />
      <ButtonPress style='col'/>
      </div>
    </div>
  );
}

export default App;
